import metadataConstants from '../constants/MetadataConstants';
import marklogicMetadataDataService from '../api/marklogicMetadataAPI';
import store from '../store';

export function  fetch_MetaData (){
    return dispatch => {
      marklogicMetadataDataService.get_PLT_Data().then(function(data){ 
        dispatch({
          type: metadataConstants.UPDATE_PLT,
          PLT_Data : JSON.parse(data.text)
        });
      })
  }
}


export function fetch_MVMData(){
  return dispatch => {
      marklogicMetadataDataService.get_MVM_Data().then(function(data){ 
        dispatch({
          type: metadataConstants.UPDATE_MVM,
          MVM_Data : JSON.parse(data.text)
        });
      })
  }
}

export function fetch_QLTData(){
  return dispatch => {
      marklogicMetadataDataService.get_QLT_Data().then(function(data){ 
        dispatch({
          type: metadataConstants.UPDATE_QLT,
          QLT : JSON.parse(data.text)
        });
      })
  }
}

export function fetch_PMDData(){
  return dispatch => {
      marklogicMetadataDataService.get_PMD_Data().then(function(data){ 
        dispatch({
          type: metadataConstants.UPDATE_PMD,
          PMD : JSON.parse(data.text)
        });
      })
  }
}

export function fetch_PName_Source() {
  return dispatch => {
      marklogicMetadataDataService.get_PName_Source().then(function(data){ 
        console.log("fetched autocomplete source is --->",data.text);
        dispatch({
          type: metadataConstants.UPDATE_PRODUCT_SOURCE,
          PNAME_SOURCE : JSON.parse(data.text)
        });
      })
  }
}

export function fetch_New_PName_Source() {
  return (dispatch) => {
    marklogicMetadataDataService.get_NEW_PName_Source().then(function(data){ 
        console.log("fetched autocomplete source is --->",data.text);
        dispatch({
          type: metadataConstants.UPDATE_PRODUCT_SOURCE,
          PNAME_SOURCE : JSON.parse(data.text)
        });
      })
  }
}

export function MVMChangeHandler(ChangedMVMFieldobj) {
  return (dispatch) => {
    store.dispatch({
        type: metadataConstants.CHANGE_MVM,
        ChangedMVMFieldobj
      })
  }
}

export function handleTagChange(tags) {
  return (dispatch) => {
    dispatch({
        type: metadataConstants.CHANGE_TAG,
        tags
      })
  }
}

export function PMDChangeHandler(ChangedMVMFieldobj) {
  return (dispatch) => {
    store.dispatch({
        type: metadataConstants.CHANGE_PMD,
        ChangedMVMFieldobj
      })
